import "../Dashboard.css";
import favicon from "../images/favicon.ico";
import landing_main1 from "../images/landing_main1.png";

const Paymentheader = () => {
  return (
    <div>
      <div className="uom-main">
        <div className="uom-image">
          <img src={favicon} alt="firespot" />
        </div>
        <div className="text-header">UOM Payment Management System</div>
      </div>
      <div>
        <button className="secure-button">Secure Payment</button>
      </div>
      <div className = "heading-main">
      <div className="heading">
        <span>Get the All Payments Ready in a Second</span>
      </div>
      <div className = "heading-image" >
        <img src={landing_main1} alt="firespot"/>
      </div>
      <div><span>The University of Moratuwa is the country's leading technological higer education institution, succeeding locally and internationally. This gateway is for quick and secure university related payments.</span></div>
      </div>
    </div>
  );
};

export default Paymentheader;
